import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Home.css'; // Ensure this path is correct
import logo from '../assets/ctrl logo.webp'; // Update the path accordingly
import '@fortawesome/fontawesome-free/css/all.min.css';
import SideBar from './SideBar'; // Assuming you have a separate SideBar component

const Home = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navigate = useNavigate();

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const handleLogout = () => {
    navigate('/logout');
  };

  return (
    <div className="home-container">
      <header className="home-header">
        <img src={logo} alt="Logo" className="logo" />
        <button className="logout-button-one" onClick={handleLogout}>
          <i className="fas fa-sign-out-alt"></i> Logout
        </button>
        <button
          className={`toggle-button-sidebar ${sidebarOpen ? 'open' : ''}`}
          onClick={toggleSidebar}
        >
          â˜°
        </button>
        <div className={`sidebar ${sidebarOpen ? 'open' : ''}`}>
          <nav className="sidebar-nav">
            <ul>
              <li><Link to="#home">Home</Link></li>
              <li><Link to="#services">Services</Link></li>
              <li><Link to="#about">About</Link></li>
              <li><Link to="#contact">Contact</Link></li>
            </ul>
          </nav>
        </div>
      </header>
      
      <div className="card-container">
        <div className="card slide-in-left">
          <h2>Domain</h2>
          <Link to="/domain">
            <button className='viewdomain'>
              View Domains
              <i className="fas fa-arrow-right icon"></i>
            </button>
          </Link>
        </div>
        <div className="card slide-in-right">
          <h2>Servers</h2>
          <Link to="/servers">
            <button className='viewservers'>
              View Servers
              <i className="fas fa-arrow-right icon"></i>
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
